import React from 'react';

class Form extends React.Component {
  render() {
    const { valueInput, descriptionInput } = this.setState;
    return (
      <form>
        <label htmlFor="value-input">
          Valor da despesa:
          {' '}
          <input
            data-testid="value-input"
            id="value-input"
            type="number"
            value={ valueInput }
          />
        </label>
        <label htmlFor="description-input">
          Descrição:
          {' '}
          <input
            data-testid="description-input"
            id="description-input"
            type="textArea"
            value={ descriptionInput }
          />
        </label>
        <label htmlFor="description-input">
          Moeda:
          {' '}
          <select
            data-testid="description-input"
            id="description-input"
            type="textArea"
            value={ descriptionInput }
          />
        </label>
      </form>
    );
  }
}
export default Form;
